INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("ほわあああぁぁ何この蝋燭！？\n思わず知的興奮で吹き消してしまったが\n怪しい残り香、興味深ぁ～！\n鼻腔から学び入ってくる～！", 111011, 0, 1, 0, 5, 1, "", 11, 1110501040, 1110501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 0, "", "", "", "", "", "", 91, 1110501041, 1110501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("vo_adv_1110501_001", "vo_adv_1110501", "", "", "", 0, 0, "", 21, 1110501042, 1110501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 111011, 0, 1, 0, 4, 1, "", 11, 1110501043, 1110501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 0, "", "", "", "", "", "", 91, 1110501044, 1110501);
