INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("是非もなし。\n端的に言えば、先輩ちょっと感激した。\n今宵は飲めや食えやの大騒ぎだ。\n朝まで踊り明かすぜ同志、ヒャッハー！", 111011, 0, 1, 0, 5, 1, "", 11, 1110501052, 1110501);
